INSERT INTO `t_goods` VALUES (1651, 'Pouch 帛琦 奢华分体式高景观婴儿推车 F90 布艺红', 'EGG因高颜值和67cm高海拔被“三个奶爸”剧组御用的，这款车的‘蛋形’承托设计，侧面曲度可以在宝宝的不同成长段，提供适宜的侧力支持，科学舒适的保护宝宝的脊柱发育，分体设计满足宝贝成长阶段的不同需求', 15999, 2199, 0.137446, 1, 27);
INSERT INTO `t_goods` VALUES (1652, 'Pouch 可折叠多功能铝合金游戏床 H13 山茶花', '多功能铝合金体床 收纳方便 超大双层空间', 2999, 599, 0.199733, 1, 28);
INSERT INTO `t_goods` VALUES (1654, 'Pouch 9月-12岁儿童安全座椅isofixKS16 咖啡色', '这款ISOfix和latch双接口汽座，造型简约，头靠高度自由调节，宝宝能够自由舒展，面料也很亲肤透气，宝宝坐久了也不会不舒服，出行中的侧翼保护系统，能有效缓冲撞击，很好的保护宝宝的头部和脊椎。', 2999, 999, 0.333111, 1, 30);
INSERT INTO `t_goods` VALUES (1655, 'Pouch高景观婴儿推车 p680旗舰版 绿色', 'POUCH的经典运动型推车，这款车稳固、耐磨同时兼顾双向推行、可坐可躺、一脚双刹。不得不提的是它的避震功能，天然橡胶轮胎加内置弹簧，同时利用车架本身的结构有效缓冲地面带来的震感，轻松面对各种路况', 3599, 899, 0.249792, 1, 31);
