INSERT INTO `t_goods` VALUES (1657, 'Pouch欧式可折叠便携式宝宝餐桌椅 K05 咖啡色', '宝宝吃饭必不可少的全能餐椅！双餐盘设计采用食品级pp材料，方便清洗的同时帮宝宝安心度过爱咬咬的长牙期， 环保皮质坐垫，污渍轻轻一擦即净，高度、靠背多档调节，让宝贝可以坐着吃、靠着玩、躺着睡！', 3899, 669, 0.171582, 1, 33);
