INSERT INTO `t_goods` VALUES (2212, '贝恩施 大颗粒积木 儿童益智场景拼接积木', '大颗粒积木，一款玩具，多款造型，光滑无毛刺不伤宝宝手。多造型拼接提高宝贝动手动脑能力；丰富的场景，给孩子游乐场的感觉。', 238, 139, 0.584034, 1, 8);
INSERT INTO `t_goods` VALUES (2213, '贝恩施 儿童轨道车 托马斯轨道火车套装彩色', '贝恩施新款电动轨道火车，款式热销，大型轨道可自由变化拼接，多套更可营造大型路轨轨迹，仿真火车鸣笛声，色彩标准鲜艳，趣味性更强，大型超市货柜主流商品，保证全部环保材质！做工精良无毛边！无毒无异味！', 159, 79, 0.496855, 1, 9);
INSERT INTO `t_goods` VALUES (2214, '贝恩施 儿童轨道车 电动赛车拼装轨道套装 B403', '电动轨道火车，款式热销，大型轨道可自由变化拼接，多套更可营造大型路轨轨迹，色彩标准鲜艳，趣味性更强。', 188, 108, 0.574468, 1, 10);
INSERT INTO `t_goods` VALUES (2215, '贝恩施 婴儿布书 宝宝的第一本书套装 A10B', '宝宝布书，6本小布书礼盒套装，内容丰富，色彩鲜艳，带牙胶，有效吸引宝宝注意力，是婴儿早教的不二之选。礼盒包装，送礼自用都很适合喔。', 88, 49, 0.556818, 1, 11);
INSERT INTO `t_goods` VALUES (2216, '贝恩施 儿童电子琴 多功能天使钢琴粉色', '贝恩施电子琴配有话筒和小凳子可以边弹边唱。可连接电源可安装电池，随时随地可使用。外形大气优美，音质如天籁般悦耳动听，质量更稳定。全新智能弹奏、无盲点自动适应，简单易用全新外观，仿真专业电子钢琴外观！', 369, 188, 0.509485, 1, 12);
INSERT INTO `t_goods` VALUES (2217, '贝恩施 益智玩具 琴鼓二合一拍拍鼓MP103+敲击果虫6938', '认知能力，音乐感知，听觉感知，运动能力。手拍鼓，电子琴，音乐，灯光伴随定宝玩耍游戏，弹奏模式，灯光模式，音乐模式，拍拍鼓模式+苹果造型打地鼠，无需装电池，非常有趣环保的玩具。', 99, 55, 0.555556, 1, 13);
INSERT INTO `t_goods` VALUES (2218, '贝恩施 卡通惯性车 益智卡通车套装 B415', '益智卡通双向惯性车，4种款式，4种不同玩法。不同的颜色造型，锻炼宝宝认知能力', 68, 39, 0.573529, 1, 14);
INSERT INTO `t_goods` VALUES (2219, '贝恩施 过家家 迷你快乐主厨厨具套装 B104', '宝宝的童年，过家家玩具扮演着不可缺少的角色，过家家玩具的趣味主要在对话、想像和创造的过程，还有模仿成人、扮演照顾者的满足感。亲们抓紧抢购哦。', 49, 39, 0.795918, 1, 15);
INSERT INTO `t_goods` VALUES (2220, '贝恩施 儿童欢乐手拍鼓电子琴MP103+婴儿布书 HX11192', '认知能力，音乐感知，听觉感知，运动能力。手拍鼓，电子琴，音乐，灯光伴随定宝玩耍游戏，弹奏模式，灯光模式，音乐模式，拍拍鼓模式+新版3本小布书内容丰富，色彩鲜艳，带牙胶和响纸。', 89, 45, 0.505618, 1, 16);
INSERT INTO `t_goods` VALUES (2221, '贝恩施 趣味八音琴 宝宝可拖拉手敲琴 3028', '采用SBS环保塑胶，色彩鲜艳，声音轻脆，非常吸引小朋友的目光。产品四周圆弧形设计，光滑无棱角，3CCC认证，安全无毒。敲击发声，耐压抗摔，适合10个月到3岁宝宝。', 69, 18, 0.26087, 1, 17);
INSERT INTO `t_goods` VALUES (2222, '贝恩施 趣味积木 智慧魔力磁片40件套 1002s', '魔幻磁力片，锻炼宝宝数学逻辑能力，肢体动感智能，研发设计智能，艺术创作智能，空间视觉智能，人际关系智能，细微观察智能', 268, 98, 0.365672, 1, 18);
INSERT INTO `t_goods` VALUES (2223, '贝恩施 儿童过家家 仿真超市手推车粉色', '仿真果蔬配件，色彩鲜艳的超市手推车，边角圆滑，转为宝宝设计，再也不怕滑伤宝宝嫩嫩的皮肤了；手推车可以激发宝宝兴趣，锻炼宝宝的肢体发展，还可以培养宝宝收纳的好习惯。', 159, 49, 0.308176, 1, 19);
INSERT INTO `t_goods` VALUES (2224, '贝恩施 过家家 宝宝切切乐水果篮(水果 蔬菜)彩色', '多种可切水果或蔬菜，锻炼宝宝动手能力。仿真的蔬菜能够让宝宝在游戏中体验日常生活中的基本小常识，增加对蔬果的了解和认识。让孩子在游戏角色中成长学习，多方面提升宝宝技能。', 159, 45, 0.283019, 1, 20);
INSERT INTO `t_goods` VALUES (2225, '贝恩施 婴幼儿脚踏钢琴健身架 B203', '贝恩施婴儿健身架，让小婴儿玩起来乐此不疲的玩具！3种玩耍模式,5款玩具挂件造型有趣,色彩鲜艳全面促进宝宝的视听觉发展,提升宝宝大动作发展。', 168, 88, 0.52381, 1, 21);
INSERT INTO `t_goods` VALUES (2226, '贝恩施 钓鱼玩具小猫钓鱼加水音乐套装绿色', '源自德国设计，宝宝右脑智力开发：贝恩施，亲子互动游戏玩具，可以同时多人进行比赛钓鱼！ 培养宝宝动手协调能力、助于脑力开发、亲子互动!3C认证、无毒无味环保材质、妈妈放心购买！', 159, 48, 0.301887, 1, 22);
INSERT INTO `t_goods` VALUES (2227, '贝恩施 儿童过家家 多功能工具收纳桶', '香港贝恩施，品质更优越，所有玩具均3C认证，环保无毒，值得您的选择！宝宝的童年，过家家玩具扮演着不可缺少的角色，过家家玩具的趣味主要在对话、想像和创造的过程，还有模仿成人、扮演照顾者的满足感。', 158, 68, 0.43038, 1, 23);
INSERT INTO `t_goods` VALUES (2228, '贝恩施 宝宝写字板 彩色卡通绘画套装 B602', '做工精细，光滑圆润。特色之处能画出彩色图案，更具创造性。不会弄脏衣服小手，宝宝无次数随意画！妈妈更省心！带卡通印章有利于学龄前小朋友充分发挥想象力和创造力', 49, 35, 0.714286, 1, 24);
INSERT INTO `t_goods` VALUES (2229, '贝恩施 益智玩具 仿真梦幻迷你梳妆台套装 88023D', '满足女孩的公主梦，仿真配件让宝宝舒心打扮，妈妈有的小公主也有，再也不用担心偷拿妈妈的被责骂了。', 89, 45, 0.505618, 1, 25);
INSERT INTO `t_goods` VALUES (2230, '贝恩施 婴儿布书 宝宝的益智早教布书套装 JL8360', '水洗不掉色 ，专为0-3岁的宝宝设计，国内外各种安全认证，柔软、撕不烂、可反复使用。真正属于宝宝自己的书。', 159, 48, 0.301887, 1, 26);
