INSERT INTO `t_goods` VALUES (2278, '贝恩施 婴儿玩具 牙胶摇铃礼盒(5件套)彩色', '3C环保认证，锻炼宝宝牙齿，摇铃生动可爱，附带牙胶，方便啃咬，锻炼手眼协调能力，让宝宝认知色彩，手脑齐锻炼，启发宝宝听觉、触觉、视觉能力，是婴儿宝宝的玩具！', 68, 39, 0.573529, 1, 16);
INSERT INTO `t_goods` VALUES (2279, '贝恩施 卡通遥控车 正版哆啦A梦益智小车红色', '可爱卡通哆啦A梦造型的遥控玩具车，带炫彩灯光和炫酷音乐。不怕摔，不怕撞，宝宝再调皮也不用担心，还有可爱小人偶，让宝宝一眼就爱上它。', 159, 58, 0.36478, 1, 17);
INSERT INTO `t_goods` VALUES (2280, '贝恩施 儿童轨道车 托马斯轨道火车套装', '贝恩施新款电动轨道火车，款式热销，大型轨道可自由变化拼接，多套更可营造大型路轨轨迹，仿真火车鸣笛声，色彩标准鲜艳，趣味性更强，大型超市货柜主流商品，保证全部环保材质！做工精良无毛边！无毒无异味！', 138, 55, 0.398551, 1, 18);
INSERT INTO `t_goods` VALUES (2281, '贝恩施 过家家 宝宝切切乐水果篮(水果 蔬菜 鱼 肉)彩色', '多种可切水果或蔬菜，锻炼宝宝动手能力。仿真的蔬菜能够让宝宝在游戏中体验日常生活中的基本小常识，增加对蔬果的了解和认识。让孩子在游戏角色中成长学习，多方面提升宝宝技能。', 159, 48, 0.301887, 1, 19);
